import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const ImageSlider = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 3000
    };

    const images = [
        "https://source.unsplash.com/800x400/?education",
        "https://source.unsplash.com/800x400/?students",
        "https://source.unsplash.com/800x400/?books"
    ];

    return (
        <Slider {...settings}>
            {images.map((img, index) => (
                <div key={index}>
                    <img src={img} alt={`Slide ${index + 1}`} />
                </div>
            ))}
        </Slider>
    );
};

export default ImageSlider;
